DROP TABLE IF EXISTS "Customer" CASCADE;
DROP TABLE IF EXISTS "Invoice" CASCADE;

CREATE TABLE "Customer"
(
    "CustomerId" INT NOT NULL,
    "FirstName" VARCHAR(40) NOT NULL,
    "LastName" VARCHAR(20) NOT NULL,
    "Company" VARCHAR(80),
    "Address" VARCHAR(70),
    "City" VARCHAR(40),
    "State" VARCHAR(40),
    "Country" VARCHAR(40),
    "PostalCode" VARCHAR(10),
    "Phone" VARCHAR(24),
    "Fax" VARCHAR(24),
    "Email" VARCHAR(60) NOT NULL,
    "SupportRepId" INT,
    CONSTRAINT "PK_Customer" PRIMARY KEY  ("CustomerId")
);

-- Najprv vytvorime tabulku kde sa nachadza specifikacia stlpaca pre customer
CREATE TABLE "Invoice"
(
    "InvoiceId" INT NOT NULL,
    "CustomerId" INT NOT NULL,
    "InvoiceDate" TIMESTAMP NOT NULL,
    "BillingAddress" VARCHAR(70),
    "BillingCity" VARCHAR(40),
    "BillingState" VARCHAR(40),
    "BillingCountry" VARCHAR(40),
    "BillingPostalCode" VARCHAR(10),
    "Total" NUMERIC(10,2) NOT NULL,
    CONSTRAINT "PK_Invoice" PRIMARY KEY  ("InvoiceId")
);

-- Nasledne vytvorime CONSTRAIN alebo obmedzenie kde specifikujeme foreign key 
-- Foreign key vie byt specifikovany aj na viac ako jeden stlpec (stlpec1, stlpec2)
-- Za REFERENCE specifikujeme rodicovsku triedu
ALTER TABLE "Invoice" ADD CONSTRAINT "FK_InvoiceCustomerId"
    FOREIGN KEY ("CustomerId") REFERENCES "Customer" ("CustomerId") ON DELETE NO ACTION ON UPDATE NO ACTION;
	



SELECT *
FROM "Customer"

SELECT *
FROM "Invoice"

-- Co ak chcem najst meno a priezvisko zakaznika co zaplatil najvacsi ucet + cena uctu?
SELECT "FirstName", "LastName", "Total"
FROM "Invoice"
JOIN "Customer"
	ON "Invoice"."CustomerId" = "Customer"."CustomerId"
ORDER BY "Invoice"."Total" DESC


-- Kolko dokopy zaplatili vsetci francuzy
-- Skuste na internete najst funkciu ktora vrati sucet hodnot v stlpci
SELECT SUM("Total")
FROM "Invoice"
JOIN "Customer"
	ON "Invoice"."CustomerId" = "Customer"."CustomerId"
WHERE 
	"Invoice"."BillingCountry" = 'France'

    

DROP TABLE IF EXISTS "Customer" CASCADE;
DROP TABLE IF EXISTS "Invoice" CASCADE;
